import React, { useEffect, useState } from "react";
import Cards from "./Cards";
import {getsReq} from './useFetch'
import {
  Route,
  Link
} from "react-router-dom";

function FetchingData() {

  const [data, setData] = useState([]);

useEffect(() => {
  getsReq().then(result => setData(result))
},[])



  return (
    <div className='container'>
    <div className="row">
        <Link to="/sellerForm">Selling</Link>
        <Link to='/watchList'>Watch List</Link>
      <h1 className="text-center">Our online shop</h1>
      {data.map((event) => {
        return <Cards key={event._id} card={event} data={data} setData={ setData}/>;
      })}
      </div>
      </div>
  );
}

export default FetchingData;
